    },
    {
        id:3,    
        route:"project_Ethernals_HACKATHON_2022",
        title:"Ethernals HACKATHON 2022",
        subtitle:<span>- designed a <span className="colored_subtitle">decentralized youtube</span>  'nekomimi'</span>,
        img:projectimg3
    }

    ]


export default projectdata ;
